            avatar:
              "https://is1-ssl.mzstatic.com/image/thumb/AMCArtistImages123/v4/83/83/b7/8383b75b-367e-30f9-c6df-fe2dd5ee444d/19354ca4-7e23-4829-9e70-55457926ec56_ami-identity-96b3a53fede2eec1677bc74d4e032408-2023-01-09T20-52-16.229Z_cropped.png/440x440bb.jpg",
            attributes: {
              artistBio:
                "Myke Towers has made himself a star by proving he has range: pop-flavored reggaetón, Latin trap, and African-infused dancehall all seep through. In the mid-2010s, the Puerto Rican wordsmith emerged as a fledgling Latin pop rapper. But when his second crossover album, 2020's <I>Easy Money Baby</I>, debuted at No. 1 on the Latin Albums chart (his first Billboard appearance), Towers quickly became one of Latin music’s most high-flying talents. Born Michael Torres in 1994 in Río Piedras, Puerto Rico, at a young age he immersed himself in his grandmother’s vast music collection, which comprised Latin American classics like salsa, merengue, and boleros. At his own home, he filled his ears with the records of Sean Paul, Ja Rule, and JAY Z, which inspired him to begin spitting bars in his late teens. He dropped his debut in 2016, <I>El Final del Principio</I>, a lyrical rap LP that harks back to the golden age of New York hip-hop. And four years later, the reggaetón-infused <I>Easy Money Baby</I> honored those influences too (lead single “Girl” features a looping sample of 50 Cent's “21 Questions”) and cut them with elements of Brazilian funk and R&B. Tellingly, the album's title expressed a laidback confidence, an acknowledgment of reaching a milestone without breaking a sweat. Superstars including Bad Bunny, Becky G., and Farruko have sought Towers out for collaborations, proving the allure of his ability to bring clever punchlines and lyrical grit to the modern, pop-leaning reggaetón canon while upholding the roots of classic Latin urban. ",
              genreNames: ["Urbano latino"],
              name: "Myke Towers",
            },
