              artistBio:
                'Hailing from Cali, Colombia, vocalist Juan David Loaiza Supúlveda began writing and releasing reggaeton under the alias of Kapo, emerging with the sensual 2019 debut single "Humo." The Cali native\'s smooth, breathy vocals and infectious melodies soon landed him a deal with La Industria Inc, and the vocalist issued a strong run of melodic singles through 2021, including "Vuela" (with Mati Gómez) and "Mochilera" (with Reykon). In April 2023 he dropped mixtape TU OG FAVORITO, before making his debut on Colombian streaming charts with a feature on Esteban Rojas\' "Bulevar." His breakout hit "Ohnana" arrived in 2024 and racked up over 20 million streams in its first month of release.',
