              artistBio:
                "For Italy’s Måneskin, rock and pop are friends, not rivals. When the Rome-based act got together in high school in 2015, its jet-setting aspirations and salacious funk rhythms differed radically from the angst-ridden groups dominating active-rock charts. Måneskin was so novel, in fact, that its sassy hooks and gift for getting dancers out of their seats initially appealed to pop audiences. After the band placed second on <i>X Factor Italia</i> in 2017, its single “ZITTI E BUONI” conquered the Eurovision Song Contest in 2021. Global rock audiences then started taking notice thanks to the unexpected viral success of “Beggin’,” a frenetic Four Seasons cover that Måneskin had recorded several years prior, as well as the unapologetically sleazy glam anthem “I WANNA BE YOUR SLAVE.” But even when they embrace full-blown hard rock on 2023’s <i>RUSH!</i>, Måneskin turns to a bevy of Scandinavian producers like Sylvester Sivertsen and Rami Yacoub to ensure that the sexed-up party anthems pulsate like club music.",
