              artistBio:
                "Vocalist Doug Robb and guitarist Dan Estrin teamed up to form California hard rock band Hoobastank after facing off in a battle of the bands when they were in high school.\n\n∙ Hoobastank’s 1998 self-released debut featured saxophone and executive production from Jeremy Wasser, who also contributed music to Incubus’ 1997 album, <i>S.C.I.E.N.C.E.</i>.\n∙ In 2001, they made their major label debut with a self-titled album that topped <i>Billboard</i>’s Heatseekers Albums chart and was certified Platinum.\n∙ “Crawling In the Dark,” their metal-influenced debut single, became a major rock radio hit and appeared in a soft drink ad starring a prefame Channing Tatum.\n∙ They have been nominated for two Grammy Awards, including Best Rock Album for their double-Platinum 2003 release, <i>The Reason</i>.\n∙ When they opened for Linkin Park’s 2004 Meteora Tour, it was a reunion of sorts: Both bands had members who attended Agoura Hills High School.",
