              "https://is1-ssl.mzstatic.com/image/thumb/AMCArtistImages126/v4/98/50/26/98502634-802d-cffa-2a90-efb9e763e512/fbdec337-71b2-4b15-9766-aa5a6668e8a8_ami-identity-a6d59b14cfc04a14ef7bce3ed3dcb6b5-2023-04-11T16-33-45.594Z_cropped.png/440x440bb.jpg",
            attributes: {
              artistBio:
                "No artists represent the exuberance of the 2010s’ EDM boom quite like Swedish House Mafia. Stockholm natives Steve Angello, Axwell, and Sebastian Ingrosso only played as a trio for a few years, but they burned brighter than virtually any of their main-stage peers, perfecting a winning fusion of radio-ready choruses and earthshaking drops—and then pulling the plug at their peak. In the circus-like atmosphere of the EDM scene, they were living proof of an adage often attributed to P.T. Barnum: “Always leave them wanting more.” <BR> All three DJs cut their teeth in the European progressive-house scene of the 2000s, and by 2007, they were informally calling themselves Swedish House Mafia. But not until 2010 did they release their first single under the name: “One,” an attention-grabbing epic whose Pharrell feature testified to the trio’s aim to conquer pop along with dance music. The next two years were a whirlwind of supersized hooks, armor-plated snares, and cheekily grandiose anthems like “Save the World,” a song that epitomized the heart-on-sleeve yearning of early-2010s EDM. Then, in 2012, they announced their farewell tour, which took them from autumn into the spring of 2013. They left behind the mix album <I>Until One</I> and the singles collection <I>Until Now</I>, the closest they came to releasing a proper full-length, along with two live albums and two documentary films. Five years later, the three reunited to headline Ultra Music Festival, teasing the possibility of future work together—and suggesting that as long as house music rules clubland, there’s a chance that Swedish House Mafia might return to reclaim their throne.",
              genreNames: ["Dance"],
              name: "Swedish House Mafia",
            },
