            attributes: {
              artistBio:
                "When the members of Sydney, Australia’s RÜFÜS DU SOL (then RÜFÜS) first got together in 2010, EDM was conquering the festival circuit, deep house was overtaking the underground, and techno was turning to the dark side. But the trio of Tyrone Lindqvist (vocals/guitar), Jon George (keyboards), and James Hunt (drums) opted for a different path. Their goal was to combine pneumatic synths, springy electronic grooves, and yearning vocal melodies into a futuristic house and pop hybrid. In doing so, they helped point the way for a new wave of DJs fusing propulsive beats and immersive chill. After the sunny tones of their 2013 debut album, <I>Atlas</I>, they recorded 2016’s <I>Bloom</I> in Berlin, rounding out the hypnotic beats of the city’s late-night party scene with a dreamy, sunrise glow. Then, in 2018, they changed their name to RÜFÜS DU SOL and flew to Venice Beach, California, to record their headiest, most psychedelic album yet, <I>SOLACE</I>. A trip to the Joshua Tree desert (just a few hours east) inspired the paranoid splendor of “Lost In My Mind,” and the whole album was marked by “a real sense of chaos,” they told Apple Music. But even at their most intense, their songs are radiant with grace. Those dichotomies are a natural part of their process. “We get pretty deep in our own little world in the studio—we’ll stay up until like 5 a.m. writing music, and the only reference point that we’ll have is each other,” said Lindqvist. “It’s not even like we’re writing for anyone else; we’re just being selfish and making the music that we’d like to make.”",
              genreNames: ["Electronic"],
              name: "RÜFÜS DU SOL",
            },
