              "https://is1-ssl.mzstatic.com/image/thumb/AMCArtistImages211/v4/92/ff/d1/92ffd151-e8d8-d573-e98a-e20f3f1bfe6d/b8b24181-f580-48d2-886e-c5cd531584c0_ami-identity-7d4c30a95a90f129a834aecd444aa07a-2024-04-02T20-24-17.424Z_cropped.png/440x440bb.jpg",
            attributes: {
              artistBio:
                "Some call the end of summer the “slow news season”—school’s still out, holidays are in full swing, and headlines tend to get weird—and Doja Cat (born Amala Ratna Zandile Dlamini in 1995) knew just what to do about it. In August of 2018, the Los Angeles singer and rapper dropped “Mooo!”, a sultry R&B jam thick with double entendres and sung from the perspective of a cow. It went viral, thanks to an unforgettable, improbably catchy chorus that had people wondering: <i>Could she possibly be for real?</i> But Doja, who released her debut EP, <i>Purrr!</i>, in 2014, and her first album, <i>Amala</i>, in 2018, was no novelty act.\n\nIn the years since, she has proven herself one of pop music’s savviest, most audacious characters. She raps nimbly, switching up her cadence from one syllable to the next, and her pop-culture nods (referencing actresses Tia and Tamera Mowry or sampling blink-182 and Paul Anka) are just as unpredictable as her dizzying flow. Her presentation is both tough and coquettish. As she demonstrated over and over on her 2019 album, <i>Hot Pink</i>, she assumes a fun and fundamentally empowered stance in her singing and rapping about sex. And woe to anyone who might take issue with that: “Sex <i>is</i> meaningful, it is!” she told Apple Music, with her trademark defiant charm.\n\nFuturistic, interplanetary adventures fueled the 2021 pop&B album <i>Planet Her</i>, which sees Doja Cat continuing her dominance in expressing the spectrum of feminine experiences. An ardent student of hip-hop, Doja builds her stylistic approach upon the nostalgic elements that colored rap’s golden eras: Her deserved cockiness intertwines with her unique personality, informed by the greats who preceded her. Her desire to be seen as a formidable MC is felt most on 2023’s <i>Scarlet</i>, a provocative project that reflects her desire for freedom and flexibility.",
              genreNames: ["R&B/Soul"],
              name: "Doja Cat",
            },
